import { BrowserRouter, Routes, Route } from "react-router-dom";


export default function App() {
  return (
    <BrowserRouter>
      <GlobalStyle />
      <Routes>
        <Route path='/' element={<LogIn />}></Route>
        <Route path='/cadastro' element={<SignIn />}></Route>
        <Route path='/hoje' element={<Today />}></Route>
      </Routes>
    </BrowserRouter>

  );
}
